import React from "react";

function Card(){
    return (
        <>
        <div className="container">
        <img src="" alt="cardpic" />
        <div className="card-info">
        <h3>A netflix Original Series</h3>
        <h4>Dark</h4>
        <button type="button">Watch Now</button>
        </div>
        
        
        
        </div>
        </>
    )
}

export default Card;
